import React, { useState } from "react";

const NextPages = () => {
  const [pageNumber, setPageNumber] = useState(0);
  return (
    <div className="pages-container">
      <i class="fa-solid fa-chevron-left"></i>
      <i class="fa-solid fa-chevron-right"></i>
    </div>
  );
};

export default NextPages;
